import NavBar from "../components/NavBar";

const Header = () => {
  return (
    <>
      <div className="bg-gray-200">
        <h1>
          <img
            className="h-24 mx-auto py-4"
            src="/logo.png"
            alt="My Daily Status"
            height="60"
          />
        </h1>
      </div>
      <NavBar />
    </>
  );
};

export default Header;
